import React, { useEffect } from "react";
import ClipLoader from "react-spinners/ClipLoader";
import { useDispatch, useSelector } from "react-redux";
import { allActivities } from "../../../redux/actions/actionCreator";
import Cookies from "universal-cookie";
import {
  Background,
  ModalWrapper,
  ModalCotent,
  CloseModal,
} from "../../../styledComponents/Dashboard/Modals/listTransactionsModal";
const ListTransactions = ({ state, setState }) => {
  const dispatch = useDispatch();
  const select = useSelector((e) => {
    return e;
  });

  const override = `
    display: block;
    margin: 0 auto;
    border-color: black;
    margin-top: 10px;
        `;

  const cookie = new Cookies();
  let userInfo = cookie.get("user info");
  let userData = { token: cookie.get("login"), id: userInfo[0].id };

  useEffect(() => {
    dispatch(allActivities(userData));
  }, [dispatch]);

  console.log(select.activity.allActivities);

  return (
    <div>
      {state.ListTransaction ? (
        <Background>
          <ModalWrapper>
            <ModalCotent>
              {!select.activity.allActivities ? (
                <ClipLoader css={override} size="30px" />
              ) : (
                select.activity.allActivities.transactions.map((e) => {
                  console.log(e.transaction_date);
                })
              )}
            </ModalCotent>
            <CloseModal
              onClick={() => {
                setState((prevstate) => ({
                  ...prevstate,
                  ListTransaction: false,
                }));
              }}
            >
              &times;
            </CloseModal>
          </ModalWrapper>
        </Background>
      ) : null}
    </div>
  );
};

export default ListTransactions;
